import farmwire from "./farmwire.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={farmwire} className="App-logo" alt="logo" />
        <p>Farmstack - ReactJS frontend</p>
      </header>
    </div>
  );
}

export default App;
